import { useNavigate, Link } from "react-router-dom";

function HomePage() {
    const navigate = useNavigate();

    return(
        <>
        <div>Hello world!</div>
        <button onClick={() => navigate('/last-matches')}>Go to About</button>
        </>
    )
}

export default HomePage;
